#回文数长度
PALINDROMIC_LEN = 10

def is_palindromic(s):
    return s == s[::-1]

def find_palindromic(src,n):
    srcLen = len(src)
    for i in range (0,srcLen - n + 1 ):
        tmp = src[i:i+n]
        if is_palindromic(tmp):
            #print ("%d:%s"%(i,tmp)) 
            return i


